import React, { Component } from "react";
import logo from './logo.svg'
import Button from 'antd/lib/button';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className='App'>
        <Button type='primary'>Button</Button>
      </div>
    );
  }
}

export default App;
